import "./App.css";

function App() {
    return (
        <div className="App">
            <div className="row no-gutters">
                <div className="col no-gutters">
                    <img
                        src="/wallpaper.jpg"
                        alt="wallpaper"
                        width="100%"
                        height="100%"
                    />
                </div>
                <div className="col no-gutters">
                    <div className="rightside"></div>
                </div>
            </div>
        </div>
    );
}

export default App;
